if ($userid== '') {
    header('location:index.php');
}

$query_checks="select * from currentgame where userid='$userid' and organizationId='$organizationId' and sessionId='$sessionId'";
$query_checks=mysqli_query($con,$query_checks);
$query_checks=mysqli_num_rows($query_checks);
$currentpos=0;
if($query_checks==0){
  if(function_exists('date_default_timezone_set')) {
    date_default_timezone_set("Asia/Kolkata");
}
   $timestamp = date('Y-m-d H:i:s');
   $insert_pos="INSERT INTO `currentgame`(`userid`,`organizationId`,`sessionId`,`pos`,`timestamp`) VALUES ('$userid','$organizationId','$sessionId','0','$timestamp')";
   mysqli_query($con,$insert_pos);
}else{
  $getpos="select * from currentgame where userid='$userid' and organizationId='$organizationId' and sessionId='$sessionId'";
  $getpos=mysqli_query($con,$getpos);
  $getpos=mysqli_fetch_object($getpos);
  $currentpos=$getpos->pos;
}

if($_SESSION['firstName']=="demo"){
  $demoprint="var isdemo=true;";
}else{
