    function scroll_map() {
        var scrollData = scrollStart[pos];
        var elmnt = document.getElementById("map-scroll");
        var id = setInterval(scrollElement, 50);

        function scrollElement() {
            if (angle[pos] == "left") {
                if (scrollData < scrollEnd[pos]) {
                    clearInterval(id);
                }
                scrollData = scrollData - 10;
            } else if (angle[pos] == "right") {
                if (scrollData > scrollEnd[pos]) {
                    clearInterval(id);
                }
                scrollData = scrollData + 10;
            }
            elmnt.scrollLeft = scrollData;
        }
    }



